import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.css'
import App from './components/App';
import * as serviceWorker from './serviceWorker';

import Moralis from './components/Moralis';

ReactDOM.render(<Moralis />, document.getElementById('root'));

Moralis.initialize("6UFGMrIZnvWpFGO6Mn9vbeTQAnNnv5EbfEniKj0D");

Moralis.serverURL = "https://khap2eeq5by1.moralishost.com:2053/server";


ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
